import React from 'react';
import Webcam from "react-webcam";

function Camera () {

    const videoConstraints = {
        facingMode: "user"
    };

    const cameraStyles = {
        'display': 'block',
        'margin': '0 auto'
    }

    return (
            <Webcam
                audio={false}
                styles={cameraStyles}
                videoConstraints={videoConstraints}
            />
    );
}

export default Camera;
